import React from "react";

const Button = (props) => {
  return (
    <div>
      <button type="button" class="d-none d-sm-block btn btn-dark mx-3 btn-lg">
        {props.titulo}
      </button>
      <button type="button" class="d-sm-none btn btn-dark my-3 btn-sm">
        {props.titulo}
      </button>
    </div>
  );
};

export default Button;
